import React from 'react';
import CosForm from '../../formCosForm'; // Pastikan path impor sesuai dengan lokasi file Anda
import Logo2 from '../../../assets/Logo2.png';

const Login = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
  };

  return (
    <div className="flex min-h-screen items-center justify-center bg-gradient-to-r from-gray-100 to-gray-200">
      <CosForm title="Login" submitText="Log In" onSubmit={handleSubmit}>
        <div>
          <img src={Logo2} alt="Logo" className="h-28 w-32 mx-auto mb-4" />
          <div>
            <label className="block text-white">Username</label>
            <input type="text" className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" placeholder="Enter your username" />
          </div>
          <div className="mt-4">
            <label className="block text-white">Password</label>
            <input type="password" className="w-full px-4 py-2 mt-2 border rounded-md focus:outline-none focus:ring-1 focus:ring-purple-600" placeholder="Enter your password" />
          </div>
        </div>
      </CosForm>
      <div className="absolute bottom-8 w-full text-center">
        <p className="text-sm text-white">Lupa Password?</p>
        <p className="text-sm text-white">
          Klik disini!! <br />
          <a href="/register" className="text-blue-600">Reset Password</a>
        </p>
      </div>
    </div>
  );
};

export default Login;
